const h3Style = {
  fontSize: "40px",
  backgroundColor: "rgb(240, 255, 255)",
  color: "rgb(31, 45, 61)",
  padding: "10px 0",
  margin: 0,
};
const dataDetailStyle = {
  display: "inline-block",
  width: "33%",
  border: "1px solid #000000",
  textAlign: "center",
  margin: "0 10px",
};

const bListliStyle = {
  display: "inline-block",
  paddingRight: "10px",
};

const buttonStyle = {
  background: "none",
};

export default {
  buttonStyle,
  bListliStyle,
  dataDetailStyle,
  h3Style,
};
